//efecto practico de impresion
async function imprimirPorFragmento(frags) {
  for (const frag of frags) {
    process.stdout.write(frag);
    await new Promise((res) => setImmediate(res)); // máximo rendimiento
  }
  process.stdout.write("\n");
}